import React from 'react';
import { Container } from 'react-bootstrap';

function Explore() {
    return (
        <Container>
        <div className="explore-main">
            <h1 className="explore-h1">Explore other options for you here</h1>
            <h2 className="">Popular cuisines near me</h2>
        </div>
        </Container>
    )
}

export default Explore
